#----------------------Main Loop----------------------#

clock = pygame.time.Clock()
fc = 0
done = False
while not done:
    fc += 1
    keys = pygame.key.get_pressed()
    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            done = True
    
    if keys[pygame.K_ESCAPE]:
        pygame.mouse.set_visible(True)
        pygame.event.set_grab(False)
        print("esc")
    else:
        delta_x, delta_y = pygame.mouse.get_rel()
        pygame.mouse.set_visible(False)
        pygame.event.set_grab(True)
        rx += delta_x/30
        ry -= delta_y/30
    if keys[pygame.K_w]:
        cx += sin(radians(rx))
        cz += cos(radians(rx))
    if keys[pygame.K_a]:
        cx += sin(radians(270 - rx))
        cz += -cos(radians(270 - rx))
    if keys[pygame.K_s]:
        cx += -sin(radians(180 - rx))
        cz += cos(radians(180 - rx))
    if keys[pygame.K_d]:
        cx += sin(radians(90 - rx))
        cz += -cos(radians(90 - rx))
    if keys[pygame.K_SPACE]:
        cy += 1
    if keys[pygame.K_LCTRL]:
        cy -= 1

    delta_x, delta_y = pygame.mouse.get_rel()
    pygame.mouse.set_visible(False)
    pygame.event.set_grab(True)
    rx += delta_x/30
    ry -= delta_y/30

    screen.fill([255,255,255])

    sea = 30

    landscape = []

    for i in range(len(l)): #creating sea
        if l[i][1] >= sea:
            landscape.append((l[i][0],l[i][1],l[i][2]))
        else:
            landscape.append((l[i][0],sea,l[i][2]))
    
    for i in range(0,len(landscape)):
        if int(i/50)%2 != 0: i += 1
        
        i = (len(landscape)-1) - i

        #colouring landscape
        try:
            if landscape[i][1] <= sea and landscape[i+1][1] <= sea and landscape[i+50][1] <= sea and landscape[i+51][1] <= sea:
                colour = [29*l[i][1]/30,109*l[i][1]/30,210*l[i][1]/30]
            else:
                colour = [91*landscape[i][1]/51,255-210*landscape[i][1]/51,39*landscape[i][1]/51]
        except: colour = [29*l[i][1]/30,109*l[i][1]/30,210*l[i][1]/30]
        
        #drawing landscape polygons
        if (i+1) % 50 != 0 and i < len(landscape) - 50:
            try:
                fill = pygame.draw.polygon(screen, colour, ((get_2d(landscape[i][0],landscape[i][1],landscape[i][2])),(get_2d(landscape[i+1][0],landscape[i+1][1],landscape[i+1][2])),(get_2d(landscape[i+51][0],landscape[i+51][1],landscape[i+51][2])),(get_2d(landscape[i+50][0],landscape[i+50][1],landscape[i+50][2]))))
                
            except: pass

    fps = int(10*clock.get_fps())/10
    fpsLabel = pygame.font.SysFont("monospace", 15).render(str(fps), 1, (0,0,0))
    screen.blit(fpsLabel, (0,0))

    pygame.display.flip()
    clock.tick(60)

pygame.quit()
